function addDataAndRender(data) {
    // this.addDataAndRender([{x: 5, y: 7}, {x: 5, y: 9}, {x: 5, y: 11}, {x: 5, y: 17}]);
    // this.addDataAndRender({x: 17, y: 7});
    // this.addDataAndRender([10, 7]);
    // this.addDataAndRender([[10, 2], [10,1]]);
    if (data == null) return;

    // We need an array with multiple datasets, but accept 1 plain object or 1 plain array, too
    if ((typeof data == 'object') && !(data instanceof Array) ||
        ((data instanceof Array) && !(data[0] instanceof Array))) {
        data = [data];
    };

    // We only accept objects that respond to #x and #y, so convert those arrays
    data = data.collect(function (element) {
        if (element instanceof Array) {
            return {x: element[0], y: element[1]};
        } else {
            return element;
        }
    });

    if (!this.data)
        this.data = data;
    else {
        if (this.maxDataLength) {
            this.data = this.data.collect(function (subData) {
                return subData.slice(subData.length - this.maxDataLength, subData.length);
            });
        }
        for (i = 0; i < this.data.length; i++) {
            // Make sure we push to all datasets, repeat last data, if no new data is given
            this.data[i].push(data[i] ? data[i] : this.data[i].last());
        }
    }

    this.render();
}

