function addDataColumnAndRender(data) {
    if (data == null) return;

    if (!this.data || data.length !== this.data.length) {
        this.data = []; // reset because of data changed
    }

    if (this.maxDataLength) {
        this.data = this.data.slice(
            this.data.length-this.maxDataLength,this.data.length);
    }

    while (data.length > this.data.length) {
        this.data.push([])
    }
    var x =  this.data[0].length ;
    this.data.forEach(function(row, index) {
        row.push({x: x, y: data[index]})
    })

    this.render();
}

